require.config({"config": {
        "text":{"PayPal_Braintree/template/payment/cc/vault.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<div class=\"payment-method\" css=\"'_active': isActive()\" id=\"payment-method-braintree-cc-vault\">\n    <div class=\"payment-method-title field choice\">\n        <input type=\"radio\"\n               name=\"payment[method]\"\n               class=\"radio\"\n               data-bind=\"\n                    attr: {'id': getId()},\n                    value: getId(),\n                    click: selectPaymentMethod,\n                    checked: isChecked,\n                    visible: isRadioButtonVisible()\"/>\n        <label class=\"label\" data-bind=\"attr: {'for': getId()}\">\n            <img data-bind=\"attr: {\n            'src': getIcons(getCardType()).url,\n            'width': getIcons(getCardType()).width,\n            'height': getIcons(getCardType()).height\n            }\" class=\"payment-icon\">\n            <span translate=\"'ending'\"></span>\n            <span text=\"getMaskedCard()\"></span>\n            (\n            <span translate=\"'expires'\"></span>:\n            <span text=\"getExpirationDate()\"></span>\n            )\n        </label>\n    </div>\n\n    <div class=\"payment-method-content\">\n        <!-- ko foreach: getRegion('messages') -->\n        <!-- ko template: getTemplate() --><!-- /ko -->\n        <!--/ko-->\n        <div class=\"payment-method-billing-address\">\n            <!-- ko foreach: $parent.getRegion(getBillingAddressFormName()) -->\n            <!-- ko template: getTemplate() --><!-- /ko -->\n            <!--/ko-->\n        </div>\n\n        <!-- ko if: showCvvVerify() -->\n        <div class=\"field cvv required\" data-bind=\"attr: {id: getId() + '_cvv_div'}\">\n            <label data-bind=\"attr: {for: getId() + '_cid'}\" class=\"label\">\n                <span><!-- ko i18n: 'Card Verification Number'--><!-- /ko --></span>\n            </label>\n            <div class=\"control\">\n                <div data-bind=\"attr: {id: getId() + '_cid'}\" class=\"hosted-control hosted-cid\"></div>\n                <div class=\"hosted-error\"><!-- ko i18n: 'Please, enter valid Card Verification Number'--><!-- /ko --></div>\n            </div>\n        </div>\n        <!-- /ko -->\n\n        <div class=\"checkout-agreements-block\">\n            <!-- ko foreach: $parent.getRegion('before-place-order') -->\n            <!-- ko template: getTemplate() --><!-- /ko -->\n            <!--/ko-->\n        </div>\n        <div class=\"actions-toolbar\">\n            <div class=\"primary\">\n                <button class=\"action primary checkout\"\n                        type=\"submit\"\n                        data-bind=\"\n                            click: placeOrder,\n                            attr: {title: $t('Place Order')}\">\n                    <span translate=\"'Place Order'\"></span>\n                </button>\n            </div>\n        </div>\n    </div>\n</div>\n"}
}});
